// Hero.js
import React from 'react';
import profilePic from './Users/jamesgreen/Downloads/Project_Website/my-app/src/assets/profile-icon.png'; // replace with the path to your image

const Hero = () => {
  return (
    <div style={{ display: 'flex', alignItems: 'center', height: '100vh' }}>
      <div style={{ width: '33.33%', height: '33.33vh' }}>
        <img src={profilePic} alt="Profile" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />
      </div>
      <div style={{ padding: '0 2rem' }}>
        <h1>Welcome to my website!</h1>
        <p>I'm a software developer specializing in front-end development. I love creating interactive and responsive web applications.</p>
      </div>
    </div>
  );
};

export default Hero;
